import React, { Component} from 'react';
import { Link } from "react-router-dom";
import { Paper, Button, CssBaseline, Container, CardContent, CardMedia, Typography } from '@material-ui/core';
import './Cards.css'


export default class Cards extends Component{
    render() {
        const { idCard } = this.props
        const { imgBannerCard } = this.props
        const { tittleCard } = this.props
        const { smallContentCard} = this.props

        return (
            <div>

                                                <Paper className='paper_sec'>
                                                    <CardMedia
                                                        className='media'
                                                        image={imgBannerCard}
                                                        title="Imagen Descripcion"
                                                    />
                                                    <CardContent>
                                                        <Typography gutterBottom variant="h5" component="h2">
                                                            {tittleCard}
                                                        </Typography>
                                                        <Typography variant="body2" color="textSecondary" component="p">
                                                            {smallContentCard}
                                                        </Typography>
                                                    </CardContent>
                                                    <Link to={"/propiedad/" + idCard}>
                                                        <Button variant="contained" color="primary" >
                                                            Ver Propiedad
                                                        </Button>
                                                    </Link>
                                                </Paper>


            </div>
        );
    }
}
